import "./App.css";

function App() {
  return (
    <main>
      <Header />
    </main>
  );
}

function Header() {
  return (
    <header className="nav">
      <div className="nav-title-container">
        <h1>NAT</h1>
        <h3>Property Services</h3>
      </div>
      <div className="nav-btn-container">
        <NavButton name="About" />
      </div>
    </header>
  );
}

function NavButton({ name }) {
  return <button className="nav-btn">{name}</button>;
}

export default App;
